  `pid` int(10) DEFAULT NULL COMMENT '上司的uid',
  `title` varchar(20) DEFAULT NULL COMMENT '部门名称',
  `job` varchar(20) DEFAULT NULL COMMENT '职位',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

